import { Footer } from "../../components/index.js";
import AboutMe from "./AboutMe.js";

const About = () => {
  document.title = "About | Catherine Mitagvaria";
  return (
    <article className="about-main">
      <AboutMe />
    
      <Footer />
    </article>
  );
};

export default About;
